import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

interface ResumeData {
  personalInfo: {
    fullName: string;
    email: string;
    phone: string;
    location: string;
    website?: string;
    linkedin?: string;
    github?: string;
  };
  summary: string;
  experience: {
    company: string;
    position: string;
    startDate: string;
    endDate: string;
    description: string;
  }[];
  education: {
    school: string;
    degree: string;
    field: string;
    startYear: string;
    endYear: string;
  }[];
  skills: string[];
  projects: {
    name: string;
    description: string;
    technologies: string[];
  }[];
}

const PreviewResume = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const resumeData = location.state?.resumeData as ResumeData;

  if (!resumeData) {
    navigate('/resume/create');
    return null;
  }

  const handleDownload = () => {
    // TODO: Implement download functionality
    console.log('Downloading resume...');
  };

  const handleEdit = () => {
    navigate('/resume/create', { state: { resumeData } });
  };

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="container mx-auto max-w-4xl px-4">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-2xl font-bold text-gray-900">Preview CV</h1>
          <div className="flex gap-4">
            <button
              onClick={handleEdit}
              className="px-4 py-2 border border-gray-300 rounded-lg text-gray-700 hover:bg-gray-50"
            >
              Edit
            </button>
            <button
              onClick={handleDownload}
              className="px-4 py-2 bg-emerald-600 text-white rounded-lg hover:bg-emerald-700"
            >
              Download PDF
            </button>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow-sm p-8">
          {/* Header */}
          <div className="text-center mb-8">
            <h1 className="text-3xl font-bold text-gray-900 mb-2">
              {resumeData.personalInfo.fullName}
            </h1>
            <div className="flex justify-center gap-4 text-gray-600">
              <span>{resumeData.personalInfo.email}</span>
              <span>•</span>
              <span>{resumeData.personalInfo.phone}</span>
              <span>•</span>
              <span>{resumeData.personalInfo.location}</span>
            </div>
            <div className="flex justify-center gap-4 mt-2">
              {resumeData.personalInfo.website && (
                <a
                  href={resumeData.personalInfo.website}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-emerald-600 hover:text-emerald-700"
                >
                  Website
                </a>
              )}
              {resumeData.personalInfo.linkedin && (
                <a
                  href={resumeData.personalInfo.linkedin}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-emerald-600 hover:text-emerald-700"
                >
                  LinkedIn
                </a>
              )}
              {resumeData.personalInfo.github && (
                <a
                  href={resumeData.personalInfo.github}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-emerald-600 hover:text-emerald-700"
                >
                  GitHub
                </a>
              )}
            </div>
          </div>

          {/* Summary */}
          <div className="mb-8">
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Professional Summary</h2>
            <p className="text-gray-600">{resumeData.summary}</p>
          </div>

          {/* Experience */}
          <div className="mb-8">
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Work Experience</h2>
            {resumeData.experience.map((exp, index) => (
              <div key={index} className="mb-6">
                <div className="flex justify-between items-start">
                  <div>
                    <h3 className="text-lg font-semibold text-gray-900">{exp.position}</h3>
                    <p className="text-gray-600">{exp.company}</p>
                  </div>
                  <div className="text-right">
                    <p className="text-gray-600">
                      {exp.startDate} - {exp.endDate}
                    </p>
                  </div>
                </div>
                <p className="text-gray-600 mt-2">{exp.description}</p>
              </div>
            ))}
          </div>

          {/* Education */}
          <div className="mb-8">
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Education</h2>
            {resumeData.education.map((edu, index) => (
              <div key={index} className="mb-6">
                <div className="flex justify-between items-start">
                  <div>
                    <h3 className="text-lg font-semibold text-gray-900">{edu.school}</h3>
                    <p className="text-gray-600">
                      {edu.degree} in {edu.field}
                    </p>
                  </div>
                  <div className="text-right">
                    <p className="text-gray-600">
                      {edu.startYear} - {edu.endYear}
                    </p>
                  </div>
                </div>
              </div>
            ))}
          </div>

          {/* Skills */}
          <div className="mb-8">
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Skills</h2>
            <div className="flex flex-wrap gap-2">
              {resumeData.skills.map((skill, index) => (
                <span
                  key={index}
                  className="px-3 py-1 bg-gray-100 text-gray-700 rounded-full text-sm"
                >
                  {skill}
                </span>
              ))}
            </div>
          </div>

          {/* Projects */}
          <div>
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Projects</h2>
            {resumeData.projects.map((project, index) => (
              <div key={index} className="mb-6">
                <h3 className="text-lg font-semibold text-gray-900">{project.name}</h3>
                <p className="text-gray-600 mt-2">{project.description}</p>
                <div className="flex flex-wrap gap-2 mt-2">
                  {project.technologies.map((tech, techIndex) => (
                    <span
                      key={techIndex}
                      className="px-3 py-1 bg-gray-100 text-gray-700 rounded-full text-sm"
                    >
                      {tech}
                    </span>
                  ))}
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default PreviewResume;
